import Quote from "./Quote";


const QuoteList = () => {
    let title ='quote list'
    return (
        <div>
            <h2>{tile}</h2>
        <Quote quote="tässä 1 quote" />
        <Quote quote="tässä 2 quote" />
        <Quote quote="tässä 3 quote" />
        
        </div>
    )
}

export default QuoteList;
